FieldEntry.Formula:
LET $removeCallback := RIGHT([HTTP Response], LEN([HTTP Response]) - 9);
LET $removeEndBracket := LEFT($removeCallback, LEN($removeCallback) - 1);
LET $decode := JSONDECODE($removeEndBracket);

LET $abnStatus := HASH_GET($decode, "AbnStatus");
LET $entityName := HASH_GET($decode, "EntityName");

RETURN
HASH(
  "ABN Status", $abnStatus,
  "Entity Name", $entityName,
  "Data", $decode,
  "Response", IF(ISBLANK(HASH_GET($decode, "Message")), [HTTP Response], HASH_GET($decode, "Message")),
  "Response Code", IF(ISBLANK(HASH_GET($decode, "Message")), [HTTP Response Code], 400)
)

