{
LET $demoMode := DB_LOOKUP("Demo Mode", "Global Settings", HASH("RecordID", 1, "LineNumber", 1));
LET $endpoint := IF($demoMode, "sandbox", "gateway");

RETURN "https://api.business.govt.nz/" & $endpoint & "/nzbn/v5/entities/" & HASH_GET($eventargs, "Business Number")
}

